import React from "react";
import "./HeroSection.css";

function HeroSection() {
  return (
    <div className="hero-container">
      <video src="./videos/video-1.mp4" autoPlay loop muted></video>
      <div className="hero-content">
        <h1>Hey there</h1>
        <p>I am Kenta</p>
      </div>
    </div>
  );
}

export default HeroSection;
